Information
------------------------------
On June 26th 2015 38 tourists, 30 of them British, were gunned down in a brutal terror attack on a Tunisian beach. Panorama's Jane Corbin hears the extraordinary stories of suffering and heroism and pieces together what actually happened with unseen footage taken by eyewitnesses. And from Tunisia she investigates whether several warnings were ignored which could have saved lives.

